import React from "react";

import "./Team.css";

import member from "../../assets/member.png";

const Team = () => {
  return (
    <div id="team">
      <h3 className="team-heading">MEET OUR TEAM</h3>
      <div className="member">
        <img src={member} alt="member" />
        <h4>Serghei Hmeli</h4>
        <p></p>
      </div>
    </div>
  );
};

export default Team;
